import React, { useState } from "react";
import Up from "../../assets/Filter/up.png";
import Down from "../../assets/Filter/down.png";
import "./SizeFilter.css";
export default function SizeFilter() {
  const [isMemorydownOpen, setIsMemoryDropdownOpen] = useState(true);
  const toggleMemoryDropdown = () => {
    setIsMemoryDropdownOpen(!isMemorydownOpen);
  };
  return (
    <div className="SizeFilter">
      <div className="buildHead">
        <p>Build-in Memory</p>
        <div onClick={toggleMemoryDropdown}>
          {isMemorydownOpen ? <img src={Up} /> : <img src={Down} />}
        </div>
      </div>
      <hr />
      {isMemorydownOpen && (
        <div className="memoryList">
          <label>
            <input
              className="check"
              type="checkbox"
              onChange={(e) =>
                setBrandName((prevBrandName) =>
                  e.target.checked
                    ? [...prevBrandName, e.target.name]
                    : prevBrandName.filter((brand) => brand !== e.target.name)
                )
              }
            />
            128GB
          </label>
          <label>
            <input
              className="check"
              type="checkbox"
              onChange={(e) =>
                setBrandName((prevBrandName) =>
                  e.target.checked
                    ? [...prevBrandName, e.target.name]
                    : prevBrandName.filter((brand) => brand !== e.target.name)
                )
              }
            />
            256GB
          </label>
          <label>
            <input
              className="check"
              type="checkbox"
              onChange={(e) =>
                setBrandName((prevBrandName) =>
                  e.target.checked
                    ? [...prevBrandName, e.target.name]
                    : prevBrandName.filter((brand) => brand !== e.target.name)
                )
              }
            />
            512GB
          </label>
          <label>
            <input
              className="check"
              type="checkbox"
              onChange={(e) =>
                setBrandName((prevBrandName) =>
                  e.target.checked
                    ? [...prevBrandName, e.target.name]
                    : prevBrandName.filter((brand) => brand !== e.target.name)
                )
              }
            />
            1TB
          </label>
        </div>
      )}
    </div>
  );
}
